import React, { useState } from 'react';
import { SuccessModal } from './SuccessModal';
import { Calendar, MapPin, Phone, Mail, User, Users, Settings, Fuel, Check, Loader2 } from 'lucide-react';
import { Card } from '../components/ui/card';
import { Input } from '../components/ui/input';
import { Label } from '../components/ui/label';
import { Button } from '../components/ui/button';

// Mock car data
const mockCar = {
  id: '1',
  name: 'Mercedes-Benz S-Class',
  brand: 'Mercedes-Benz',
  model: 'S-Class',
  year: 2024,
  image: 'https://images.unsplash.com/photo-1599912027667-755b68b4dd3b?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=M3w3Nzg4Nzd8MHwxfHNlYXJjaHwxfHxsdXh1cnklMjBjYXIlMjBpbnRlcmlvcnxlbnwxfHx8fDE3NjY0OTA2Njl8MA&ixlib=rb-4.1.0&q=80&w=1080',
  seats: 5,
  transmission: 'Automatic',
  fuelType: 'Hybrid',
  pricePerDay: 250,
  currency: 'AED',
  available: true
};

const BookingForm = () => {
  const [submitting, setSubmitting] = useState(false);
  const [showSuccess, setShowSuccess] = useState(false);
  const [formData, setFormData] = useState({
    startDate: '',
    endDate: '',
    pickupLocation: '',
    contactNumber: '',
    customerEmail: '',
    customerName: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const calculateTotal = () => {
    if (!formData.startDate || !formData.endDate) return 0;
    const start = new Date(formData.startDate);
    const end = new Date(formData.endDate);
    const days = Math.ceil((end.getTime() - start.getTime()) / (1000 * 60 * 60 * 24));
    return days > 0 ? days * mockCar.pricePerDay : 0;
  };

  const totalDays = formData.startDate && formData.endDate
    ? Math.ceil((new Date(formData.endDate).getTime() - new Date(formData.startDate).getTime()) / (1000 * 60 * 60 * 24))
    : 0;

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);

    // Simulate API call
    await new Promise(resolve => setTimeout(resolve, 2000));

    setSubmitting(false);
    setShowSuccess(true);

    // Log booking details
    console.log('ðŸŽ‰ Booking Created!', {
      car: mockCar,
      ...formData,
      totalDays,
      totalPrice: calculateTotal()
    });
  };

  const handleCloseSuccess = () => {
    setShowSuccess(false);
    // Reset form
    setFormData({
      startDate: '',
      endDate: '',
      pickupLocation: '',
      contactNumber: '',
      customerEmail: '',
      customerName: ''
    });
  };

  return (
    <>
      <div className="container mx-auto px-4 py-8 md:py-12">
        {/* Header */}
        <div className="text-center mb-8 md:mb-12">
          <h1 className="text-4xl md:text-5xl font-bold bg-gradient-to-r from-indigo-600 via-purple-600 to-pink-600 bg-clip-text text-transparent mb-3">
            Book Your Dream Car
          </h1>
          <p className="text-lg text-gray-600">
            Complete your booking details below for a premium experience
          </p>
        </div>

        <div className="grid lg:grid-cols-2 gap-8 max-w-7xl mx-auto">
          {/* Car Summary Card */}
          <Card className="p-0 overflow-hidden bg-white/80 backdrop-blur-sm shadow-xl hover:shadow-2xl transition-shadow duration-300">
            <div className="relative h-64 md:h-80 overflow-hidden">
              <img 
                src={mockCar.image} 
                alt={mockCar.name}
                className="w-full h-full object-cover"
              />
              <div className="absolute inset-0 bg-gradient-to-t from-black/60 via-black/20 to-transparent" />
              <div className="absolute bottom-0 left-0 right-0 p-6 text-white">
                <h2 className="text-2xl md:text-3xl font-bold mb-2">{mockCar.name}</h2>
                <p className="text-white/90">
                  {mockCar.brand} {mockCar.model} ({mockCar.year})
                </p>
              </div>
            </div>

            <div className="p-6 space-y-6">
              {/* Specifications */}
              <div className="grid grid-cols-3 gap-4">
                <div className="flex flex-col items-center p-4 bg-gradient-to-br from-indigo-50 to-purple-50 rounded-xl">
                  <Users className="h-6 w-6 text-indigo-600 mb-2" />
                  <span className="text-sm text-gray-600">Seats</span>
                  <span className="font-semibold text-gray-900">{mockCar.seats}</span>
                </div>
                <div className="flex flex-col items-center p-4 bg-gradient-to-br from-purple-50 to-pink-50 rounded-xl">
                  <Settings className="h-6 w-6 text-purple-600 mb-2" />
                  <span className="text-sm text-gray-600 text-center">Trans.</span>
                  <span className="font-semibold text-gray-900 text-xs">{mockCar.transmission}</span>
                </div>
                <div className="flex flex-col items-center p-4 bg-gradient-to-br from-pink-50 to-indigo-50 rounded-xl">
                  <Fuel className="h-6 w-6 text-pink-600 mb-2" />
                  <span className="text-sm text-gray-600">Fuel</span>
                  <span className="font-semibold text-gray-900">{mockCar.fuelType}</span>
                </div>
              </div>

              {/* Price */}
              <div className="bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 rounded-xl p-6 text-white text-center">
                <p className="text-sm opacity-90 mb-1">Daily Rate</p>
                <p className="text-4xl font-bold">{mockCar.pricePerDay} <span className="text-xl">{mockCar.currency}</span></p>
                <p className="text-sm opacity-90 mt-1">per day</p>
              </div>
            </div>
          </Card>

          {/* Booking Form */}
          <Card className="p-6 md:p-8 bg-white/80 backdrop-blur-sm shadow-xl">
            <h3 className="text-2xl font-bold text-gray-900 mb-6">Booking Details</h3>

            <form onSubmit={handleSubmit} className="space-y-6">
              {/* Date Selection */}
              <div className="grid md:grid-cols-2 gap-4">
                <div className="space-y-2">
                  <Label htmlFor="startDate" className="flex items-center gap-2 text-gray-700">
                    <Calendar className="h-4 w-4 text-indigo-600" />
                    Start Date *
                  </Label>
                  <Input
                    type="date"
                    id="startDate"
                    name="startDate"
                    value={formData.startDate}
                    onChange={handleChange}
                    min={new Date().toISOString().split('T')[0]}
                    required
                    className="border-gray-300 focus:border-indigo-500 focus:ring-indigo-500"
                  />
                </div>

                <div className="space-y-2">
                  <Label htmlFor="endDate" className="flex items-center gap-2 text-gray-700">
                    <Calendar className="h-4 w-4 text-purple-600" />
                    End Date *
                  </Label>
                  <Input
                    type="date"
                    id="endDate"
                    name="endDate"
                    value={formData.endDate}
                    onChange={handleChange}
                    min={formData.startDate || new Date().toISOString().split('T')[0]}
                    required
                    className="border-gray-300 focus:border-purple-500 focus:ring-purple-500"
                  />
                </div>
              </div>

              {/* Location */}
              <div className="space-y-2">
                <Label htmlFor="pickupLocation" className="flex items-center gap-2 text-gray-700">
                  <MapPin className="h-4 w-4 text-pink-600" />
                  Pickup Location
                </Label>
                <Input
                  type="text"
                  id="pickupLocation"
                  name="pickupLocation"
                  value={formData.pickupLocation}
                  onChange={handleChange}
                  placeholder="Enter pickup location"
                  className="border-gray-300 focus:border-pink-500 focus:ring-pink-500"
                />
              </div>

              {/* Contact Information */}
              <div className="space-y-2">
                <Label htmlFor="customerName" className="flex items-center gap-2 text-gray-700">
                  <User className="h-4 w-4 text-indigo-600" />
                  Your Name
                </Label>
                <Input
                  type="text"
                  id="customerName"
                  name="customerName"
                  value={formData.customerName}
                  onChange={handleChange}
                  placeholder="Enter your full name"
                  className="border-gray-300 focus:border-indigo-500 focus:ring-indigo-500"
                />
              </div>

              <div className="grid md:grid-cols-2 gap-4">
                <div className="space-y-2">
                  <Label htmlFor="customerEmail" className="flex items-center gap-2 text-gray-700">
                    <Mail className="h-4 w-4 text-purple-600" />
                    Email Address *
                  </Label>
                  <Input
                    type="email"
                    id="customerEmail"
                    name="customerEmail"
                    value={formData.customerEmail}
                    onChange={handleChange}
                    placeholder="your@email.com"
                    required
                    className="border-gray-300 focus:border-purple-500 focus:ring-purple-500"
                  />
                </div>

                <div className="space-y-2">
                  <Label htmlFor="contactNumber" className="flex items-center gap-2 text-gray-700">
                    <Phone className="h-4 w-4 text-pink-600" />
                    Contact Number
                  </Label>
                  <Input
                    type="tel"
                    id="contactNumber"
                    name="contactNumber"
                    value={formData.contactNumber}
                    onChange={handleChange}
                    placeholder="+971 XX XXX XXXX"
                    className="border-gray-300 focus:border-pink-500 focus:ring-pink-500"
                  />
                </div>
              </div>

              {/* Booking Summary */}
              {totalDays > 0 && (
                <div className="bg-gradient-to-br from-indigo-50 via-purple-50 to-pink-50 rounded-xl p-6 border-2 border-indigo-100">
                  <h4 className="font-semibold text-gray-900 mb-4">Booking Summary</h4>
                  <div className="space-y-3">
                    <div className="flex justify-between text-sm">
                      <span className="text-gray-600">Total Days:</span>
                      <span className="font-semibold text-gray-900">{totalDays} {totalDays === 1 ? 'day' : 'days'}</span>
                    </div>
                    <div className="flex justify-between text-sm">
                      <span className="text-gray-600">Price per Day:</span>
                      <span className="font-semibold text-gray-900">{mockCar.pricePerDay} {mockCar.currency}</span>
                    </div>
                    <div className="h-px bg-gradient-to-r from-indigo-200 via-purple-200 to-pink-200"></div>
                    <div className="flex justify-between">
                      <span className="font-semibold text-gray-900">Total Price:</span>
                      <span className="text-2xl font-bold bg-gradient-to-r from-indigo-600 via-purple-600 to-pink-600 bg-clip-text text-transparent">
                        {calculateTotal()} {mockCar.currency}
                      </span>
                    </div>
                  </div>
                </div>
              )}

              {/* Submit Button */}
              <Button
                type="submit"
                disabled={submitting || !formData.startDate || !formData.endDate || !formData.customerEmail}
                className="w-full h-12 bg-gradient-to-r from-indigo-600 via-purple-600 to-pink-600 hover:from-indigo-700 hover:via-purple-700 hover:to-pink-700 text-white shadow-lg hover:shadow-xl transition-all duration-300 disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {submitting ? (
                  <>
                    <Loader2 className="mr-2 h-5 w-5 animate-spin" />
                    Processing Booking...
                  </>
                ) : (
                  <>
                    <Check className="mr-2 h-5 w-5" />
                    Confirm Booking
                  </>
                )}
              </Button>
            </form>
          </Card>
        </div>
      </div>

      {/* Success Modal */}
      <SuccessModal 
        open={showSuccess} 
        onClose={handleCloseSuccess}
        bookingDetails={{
          carName: mockCar.name,
          totalDays,
          totalPrice: calculateTotal(),
          currency: mockCar.currency,
          customerEmail: formData.customerEmail
        }}
      />
    </>
  );
}
export default BookingForm;
